// gender grade assessor sym
function SubmitBtn(){
// All Calculator
	var SNAP_score = [0,0,0];

	for(let i=0; i<26; i++) for(let j=0; j<4; j++) if(document.getElementsByName(("SNAP"+(i+1)))[j].checked) {
		if(i < 9) {
			SNAP_score[0] += j;
		}else if(i < 18){
			SNAP_score[1] += j;
		}else{
			SNAP_score[2] += j;
		}
	}

// get BasicInfo
	var AllBasicInfo = document.getElementsByName("BasicInfo");
	var cli_norm = SNAP_Norm[AllBasicInfo[0].value][AllBasicInfo[1].value][AllBasicInfo[2].value];

// get score
	var SNAP_rawText = document.getElementsByName("SNAP_raw");
	var SNAP_PRText = document.getElementsByName("SNAP_PR");

	for(let i=0; i<3; i++){
		SNAP_rawText[i].innerHTML = SNAP_score[i];
		SNAP_PRText[i].innerHTML = cli_norm[i][SNAP_score[i]];
	}
}


